import React from 'react';
import Header from './header.js';
import Footer from './footer.js';

function Home(){
	return (
		<div>
			<div className="header">
				<Header />
				<div
					style={{
						display: 'flex',
						justifyContent: 'center',
						alignItems: 'center',
						height: '90vh'
					}}
				>
					<h1>HOME</h1>
				</div>
			</div>
			<Footer />
		</div>
	)
}

export default Home;
